import cat from '../img/cute_cat.jpg';
//Styled
import styled from 'styled-components';

const AboutSection = () => {
    return(
        <StyledAbout>
            <div className="description">
                <div className="title">
                    <div className="hide">
                        <h2>We are here to</h2>
                    </div>
                    <div className="hide">
                        <h2>make your <span>dreams</span></h2>
