                        <h2>come true</h2>
                    </div>
                </div>
                <p>
                Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut sed 
                diam pharetra, vehicula purus sed, sagittis odio. Cras tellus tortor,
                </p>
            </div>
            <div className="cat-image">
                <img src={cat} alt="cat"/>
            </div>
        </StyledAbout>
    );
};

//Styled Components 
const StyledAbout = styled.div`
    min-height: 90vh;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 5rem 10rem;
    color: black;
`;

export default AboutSection
